import { useNavigate, useParams } from 'react-router-dom';

import BookCard from './BookCard';
import './BookItem.css';

const BookItem = ({books}) => {

    const navigate = useNavigate();
    const {id} = useParams();

    const routeDetail = () => {
        navigate(`detail/${id}`);
    };

    return (
        <li onClick={routeDetail}>
            <BookCard className="bookItem">
                <div>
                    {books}
                </div>
            </BookCard>
        </li>
    )
}

export default BookItem;
